import React from 'react';
import { NavLink } from 'react-router-dom';
import Logo from './logoHenry.png'

import s from './NavBar.css';

export default function NavBar() {
    return (
        <header className={s.navbar}>
            <div>
                <img id={s.logoHenry} src={Logo} width="30" height="30" className="d-inline-block align-top" alt="" />
            </div>
            <nav>
                <ul className={s.list}>
                    <li className={s.list-item}>
                        <NavLink class={s.navlink} exact to="/home" >Home</NavLink>
                        <NavLink class={s.navlink} to="/form" >Crear Receta</NavLink>
                    </li>
                </ul>
            </nav>
        </header>
    )
}
